import styled from 'styled-components';

const StyledKeywordSearch = styled.div`
  height: 100%;
`;

const TextInput = styled.input``;

const Button = styled.div``;

const KeywordSearch = () => (
  <StyledKeywordSearch>
    <form>
      <TextInput type="text" />
      <Button>+</Button>
    </form>
  </StyledKeywordSearch>
);

export default KeywordSearch;
